import React, { useEffect, useRef, useState } from 'react'
import Rahul from './Img/Rahul.png'
import top2 from './Img/top2.png'
import top3 from './Img/top3.png'
import top4 from './Img/top4.png'
import searchgif from './Vedio/search.gif'
function AllPlacement() {
    const list = [
        {
            name: 'Rahul Thapliyal',
            imgurl: Rahul,
            Companyname: 'MicroSoft',
            packages: '43.3',
            duration: '2016-20'
        }, {
            name: 'Taranjeet Kaur',
            imgurl: top2,
            Companyname: 'Adobe',
            packages: '43.17',
            duration: '2016-20'
        }, {
            name: 'Riya Verma',
            imgurl: top3,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Himakshi Salhotra',
            imgurl: top4,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Rahul Thapliyal',
            imgurl: Rahul,
            Companyname: 'MicroSoft',
            packages: '43.3',
            duration: '2016-20'
        }, {
            name: 'Taranjeet Kaur',
            imgurl: top2,
            Companyname: 'Adobe',
            packages: '43.17',
            duration: '2016-20'
        }, {
            name: 'Riya Verma',
            imgurl: top3,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Himakshi Salhotra',
            imgurl: top4,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Rahul Thapliyal',
            imgurl: Rahul,
            Companyname: 'MicroSoft',
            packages: '43.3',
            duration: '2016-20'
        }, {
            name: 'Taranjeet Kaur',
            imgurl: top2,
            Companyname: 'Adobe',
            packages: '43.17',
            duration: '2016-20'
        }, {
            name: 'Riya Verma',
            imgurl: top3,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Himakshi Salhotra',
            imgurl: top4,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Rahul Thapliyal',
            imgurl: Rahul,
            Companyname: 'MicroSoft',
            packages: '43.3',
            duration: '2016-20'
        }, {
            name: 'Taranjeet Kaur',
            imgurl: top2,
            Companyname: 'Adobe',
            packages: '43.17',
            duration: '2016-20'
        }, {
            name: 'Riya Verma',
            imgurl: top3,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Himakshi Salhotra',
            imgurl: top4,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }
    ]
    const [search, setSearch] = useState('');
    var count = 0;
    const myref = useRef();
    const handlecount = (val) => {
        count = val;
        return 1;
    }
    const isEqual = (itemE, searchV) => {
        itemE = itemE.toUpperCase();
        let searchp = searchV;
        searchV = searchV.toUpperCase();
        if (searchp === searchV && itemE.indexOf('-') === -1) {
            return parseInt(itemE) >= parseInt(searchV);
        }
        let value = itemE.indexOf(searchV);
        if (value !== -1) {
            return true;
        }
        else {
            return false;
        }
    }

    useEffect(() => {
        window.scrollTo(0, 0);
    }, [])

    return (
        <>
            <div className='h-full w-full bg-white mt-4'>
                <div className='flex flex-col justify-center rounded items-center w-full sm:w-[98%] mx-auto text-center shadow-md'>
                    <div className='flex flex-col p-2 mx-2 my-10 text-center text-opacity-95 text-gray-700'>
                        <span className='text-4xl font-sans font-bold'>Placements </span>
                        <span className='text-xl font-mono font-semibold '> (Computer Science and Engineering)</span>
                    </div>
                    <div className='m-3 block w-full mb-16'>
                        <input placeholder='Search by (Company Name, Packages or year)' defaultValue={search} onChange={(e) => { setSearch(e.target.value) }} className='w-4/5 md:w-2/3 lg:w-1/3 m-4 p-2 text-lg rounded border-2 shadow-lg border-gray-300 focus:border-gray-400 focus:outline-none' />
                    </div>
                    <div className='grid grid-cols-1 lg:grid-cols-2 colplace m-2 lg:mx-4 w-full items-center justify-center place-items-center text-gray-700 over'>
                        {
                            list.map((item, i) => {
                                return search ? ((isEqual(item.packages, search) || isEqual(item.duration, search) || isEqual(item.Companyname, search)) ? (handlecount(1)) && (
                                    < div key={i} ref={myref} className='w-[75%] sm:w-full m-2  h-[21rem] flex items-center justify-center group'>
                                        <div className='card border border-white rounded-lg'>
                                            <div className='text-center font-medium text-xl p-2 group-hover:text-2xl duration-500'>{item.name}</div>
                                            <div className="flex flex-col items-center pb-10">
                                                <img className="m-2 mb-3 w-28 h-28 rounded-full border-gray-600 shadow-xl group-hover:w-32 group-hover:h-32 duration-500" src={item.imgurl} alt="..." />
                                                <h4 className="m-1 text-xl font-medium text-gray-600 italic group-hover:text-2xl duration-500">{item.Companyname}</h4>
                                                <h4 className="text-lg text-gray-500  group-hover:text-xl duration-500">{item.packages} L.P.A</h4>
                                                <h4 className="text-lg text-gray-500group-hover:text-xl duration-500">({item.duration})</h4>
                                            </div>
                                        </div>
                                    </div>
                                ) : <></>) : (handlecount(0)) &&
                                (
                                    <div role="listitem" class="max-w-[400px] relative mb-24 mx-2 xl:max-w-sm">
                                    <div class="rounded border overflow-hidden shadow-md bg-white">
                                        <div class="absolute -mt-20 w-full flex justify-center">
                                            <div class="h-32 w-32">
                                                <img src={item.imgurl} alt="Display Picture of Charles Keith" role="img" class="rounded-full object-cover h-full w-full shadow-md" />
                                            </div>
                                        </div>
                                        <div class="px-6 mt-16 flex flex-col items-center justify-center">
                                            <h1 class="font-semibold text-2xl text-center mb-1">{item.name}</h1>
                                            <p class="text-gray-800 font-medium text-lg text-center">{item.Companyname}</p>
                                            <p class="text-center text-gray-600 text-base pt-3 font-normal">A UX designer is the voice of the customer. Our job is to look beyond the business goals. We don't just experience user interface but also questions it.</p>
                                            <div class="w-full flex justify-center pt-5 pb-5">
                                                <a href="javascript:void(0)" class="mx-5">
                                                    <div aria-label="Github" role="img">
                                                        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="#718096" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" class="feather feather-github">
                                                            <path d="M9 19c-5 1.5-5-2.5-7-3m14 6v-3.87a3.37 3.37 0 0 0-.94-2.61c3.14-.35 6.44-1.54 6.44-7A5.44 5.44 0 0 0 20 4.77 5.07 5.07 0 0 0 19.91 1S18.73.65 16 2.48a13.38 13.38 0 0 0-7 0C6.27.65 5.09 1 5.09 1A5.07 5.07 0 0 0 5 4.77a5.44 5.44 0 0 0-1.5 3.78c0 5.42 3.3 6.61 6.44 7A3.37 3.37 0 0 0 9 18.13V22"></path>
                                                        </svg>
                                                    </div>
                                                </a>
                                                <a href="javascript:void(0)" class="mx-5">
                                                    <div aria-label="Twitter" role="img">
                                                        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="#718096" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" class="feather feather-twitter">
                                                            <path d="M23 3a10.9 10.9 0 0 1-3.14 1.53 4.48 4.48 0 0 0-7.86 3v1A10.66 10.66 0 0 1 3 4s-4 9 5 13a11.64 11.64 0 0 1-7 2c9 5 20 0 20-11.5a4.5 4.5 0 0 0-.08-.83A7.72 7.72 0 0 0 23 3z"></path>
                                                        </svg>
                                                    </div>
                                                </a>
                                                <a href="javascript:void(0)" class="mx-5">
                                                    <div aria-label="Instagram" role="img">
                                                        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="#718096" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" class="feather feather-instagram">
                                                            <rect x="2" y="2" width="20" height="20" rx="5" ry="5"></rect>
                                                            <path d="M16 11.37A4 4 0 1 1 12.63 8 4 4 0 0 1 16 11.37z"></path>
                                                            <line x1="17.5" y1="6.5" x2="17.51" y2="6.5"></line>
                                                        </svg>
                                                    </div>
                                                </a>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                )
                            })
                        }
                    </div>
                    {
                        count === 0 && search ?
                            <div className='mb-4 flex w-full items-center justify-center'>
                                <div className='w-[75%] sm:w-full m-2  h-[21rem] flex items-center justify-center'>
                                    <div className='card border h-full border-white text-gray-700 rounded-lg flex flex-col items-center text-2xl font-semibold italic justify-center'>
                                        <img src={searchgif} alt='...' />
                                        <span className='my-10 italic'>No Pages Found!</span>
                                    </div>
                                </div>
                            </div> : <></>
                    }
                </div>
            </div>
        </>
    )
}

export default AllPlacement
